import React, {useState, useEffect} from "react";
import "../styles/cafes.css";
import LocationCard from "../shared/LocationCard";
import CommonSection from "../shared/cafe/CommonSection-cafe";
import SearchBar from "../shared/SearchBar";
import { Col, Container, Row } from "reactstrap";
import cafeData from "../assets/data/cafes";

const Cafes = () => {
    const [pageCount, SetPageCount] = useState(0)
    const [page, setPage] = useState(0)

    useEffect(()=>{
        const pages = Math.ceil(5/ 4)
        SetPageCount(pages)
    },[page])

    return (
    <>
    <CommonSection title={"All Cafes"} />
    <section>
        <Container>
            <Row>
                <SearchBar />
            </Row>
        </Container>
    </section>
    <section>
        <Container>
            <Row>
                {
                    cafeData?.map(location => <Col lg="3" key={location.id}> <LocationCard location={location} /></Col>)

                }
            </Row>
        </Container>
    </section>
    </>
    )

};
export default Cafes;
